        getId(){
          const that = this
          that.xid = sessionStorage.getItem('xid')
          if(!that.xid){
            that.$message.error('未知用户，请重新登录')
            setTimeout(()=>{
              window.location = './login.html'
            },1500)
          }
        },
        dataURLtoFile(dataurl, filename) {
          var arr = dataurl.split(',');
          console.log(arr[1]);return;
            bstr = atob(arr[1]), n = bstr.length, u8arr = new Uint8Array(n);
          while(n--){
            u8arr[n] = bstr.charCodeAt(n);
          }
          const a = new File([u8arr], filename, {type:mime});
          console.log(a)
        },
				file(){
          const that = this
					that.dataURLtoFile(that.fileUrl,'合同',)
					return

          eleLink.download = '合同';
          eleLink.style.display = 'none';
          var blob = new Blob([u8arr], {
            type: "application/msword"
          });
          eleLink.href = URL.createObjectURL(blob);
          // 触发点击
          document.body.appendChild(eleLink);
          eleLink.click();

          const that = this
          const id = getUrlKey('id')
          that.loading = true
          $.ajax({
            type:"get",
            url: `https://ec2-18-209-228-104.compute-1.amazonaws.com:8443/v1/compute/${id}`,

            ContentType: "application/json",

              that.getWord()
            }

        getWord(){
          const that = this
					const id = getUrlKey('id')
          that.loading = true
          $.ajax({
            type:"get",
            url: `${HOST1}session/${id}/download`,
            dataType: "json",
            ContentType: "application/json",
            beforeSend: function (XMLHttpRequest) {
            	XMLHttpRequest.setRequestHeader('x-dc-uid', that.xid);
            },
						headers:{
              'X-DC-UID':that.xid
						},
            success:(res)=>{
              console.log(res);
            }
          })
          return
          network({
            params: {
              "session_id ": id
            },
            path: `session/${id}/download`,
            method: 'get',
            head: [

            ],
            success: function (e) {
              that.loading = false
              const data = JSON.parse(e);

            }
